function One(props){
    return(
        <div>
            <p>ID:{props.x}</p>
            <p>Name:{props.y}</p>
            <p>State:{props.z}</p>
            <p>Mobile:{props.n}</p>
            <p>Country:{props.p}</p>
        </div>
    )
}
export default One;
